{
	render() {
		BasePopupElement.define();
		DivTableElement.define();

		const popup = document.createElement('wc-base-popup');
		popup.open = true;
		const table = document.createElement('wc-div-table');
		table.cards = cards;
		popup.append(table);

		return html`<button @click=${() => popup.showModal()}>Open</button>${popup}`;
	},
}

